import React , { useEffect , useState } from "react";

function Test () {

	const [ elLibro , setElLibro ] = useState([]);

	useEffect(() => {
		const api = "https://www.googleapis.com/books/v1/volumes?q=papelucho";
		
		fetch( api )
		.then( libro => libro.json() )
		.then( libro => {
			// console.log( libro );
			
			var todo = [];
			
			for ( var count = 0; count <= libro.items.length-1; count++ ) {
				var getLibro = {
					"id" : libro.items[ count ].id ,
					"etag" : libro.items[ count ].etag ,
					"nombre" : libro.items[ count ].volumeInfo.title ,
				};

				console.log( `Nombre: ${ getLibro.nombre }` );
				todo.push({ "nombre" : getLibro.nombre , "id" : getLibro.id , "etag" : getLibro.etag });

			};
			
			setElLibro( todo );
		});
		
	},[]);
	

	return (
		<section className="test">
			<h2>Libros</h2>
			<ul className="libro">
				{
					elLibro.map( ( librito ) => {
						return (
								<li key={ librito.id }>{ librito.nombre }</li>
						);
					})
				}
			</ul>
			
			
			
		</section>
	);
};

export default Test;
